import React  from 'react';
import Nav from 'react-bootstrap/Nav';
import Link from 'next/link';
import StyledLink from './StyledLink';

function SiteNav(props) {

    return (
        <Nav variant="pills" activeKey="/home" as="ul" className="site">

            <Nav.Item as="li">
                <StyledLink url="/home" name="Home" />
            </Nav.Item>

            <Nav.Item as="li">
                <Nav.Link as={Link} eventKey="3" href="/portfolio" className="tabs" activeClassName="active">Portfolio</Nav.Link>
            </Nav.Item>

            <Nav.Item as="li">
                <Nav.Link as={Link} eventKey="4" href="/skills" className="tabs" activeClassName="active">Skills</Nav.Link>
            </Nav.Item>

            <Nav.Item as="li">
                   <a href="/pdfs/resume.pdf" target="_blank" className="tabs">Resume(PDF)</a>
            </Nav.Item>

            <Nav.Item as="li">
                <Nav.Link as={Link} eventKey="6" href="/contact" className="tabs" activeClassName="active">Contact</Nav.Link>
            </Nav.Item>

        </Nav>
    )
}

export default SiteNav;
